import React from 'react'
import depictPicture from '../../assets/img/depict.svg'
import  '../navbar/navbar.css'
import { useRef } from 'react'



export default function Navbar() {

  const textVisibleBtnOrange = useRef();
  console.log(textVisibleBtnOrange);

  const enterBtnOrange =()=>{
    console.log("oui");
  }

  return (
    <nav className='navbar'>
        <img src={depictPicture} alt="" />
        <ul>
            <li>Product</li>
            <li>Customers</li>
            <li>Pricing</li>
            <li>Sign in</li>
            <div className='btnOrange'>
              <p className='pBtnOrange'>
                <span ref={textVisibleBtnOrange} onMouseEnter={enterBtnOrange} className='visibleSpan'>start for free</span>
                <span className='invisibleSpan'>start for free</span>
              </p>
            </div>
        </ul>
    </nav>
  )
}
